            display: flex;
            flex-direction: column;
            align-items: flex-end;
            font-family: 'Inter', sans-serif;
        }

        #chat-window {
            width: 380px;
            height: 600px;
            background: white;
            border-radius: 20px;
            box-shadow: 0 20px 50px rgba(0,0,0,0.2);
            display: none; /* 기본 숨김 */
            flex-direction: column;
            overflow: hidden;
            margin-bottom: 20px;
            border: 1px solid rgba(0,0,0,0.1);
            transform-origin: bottom right;
        }
        .dark #chat-window {
            background: #1e293b;
            border: 1px solid rgba(255,255,255,0.1);
        }

        #chat-header {
            background: linear-gradient(135deg, #3b82f6, #8b5cf6);
            padding: 20px;
            color: white;
            display: flex;
            justify-content: space-between;
            align-items: center;
        }

        #chat-messages {
            flex: 1;
            padding: 20px;
            overflow-y: auto;
            background: #f8fafc;
        }
        .dark #chat-messages {
            background: #0f172a;
        }

        #chat-input-area {
            padding: 16px;
            background: white;
            border-top: 1px solid #e2e8f0;
            display: flex;
            gap: 10px;
        }
        .dark #chat-input-area {
            background: #1e293b;
            border-top: 1px solid #334155;
        }

        .chat-msg {
            margin-bottom: 12px;
            max-width: 80%;
            padding: 12px 16px;
            border-radius: 16px;
            font-size: 0.95rem;
            line-height: 1.5;
            animation: slideIn 0.3s ease-out;
        }
        .msg-bot {
            background: white;
            border: 1px solid #e2e8f0;
            color: #1e293b;
            border-bottom-left-radius: 4px;
            align-self: flex-start;
        }
        .dark .msg-bot {
            background: #334155;
            border: 1px solid #475569;
            color: #f8fafc;
        }
        .msg-user {
            background: #3b82f6;
            color: white;
            border-bottom-right-radius: 4px;
            align-self: flex-end;
            margin-left: auto;
        }

        #chat-toggle-btn {
            width: 60px;
            height: 60px;
            border-radius: 30px;
            background: #3b82f6;
            color: white;
            display: flex;
            align-items: center;
            justify-content: center;
            cursor: pointer;
            box-shadow: 0 4px 14px rgba(59, 130, 246, 0.4);
            transition: transform 0.2s;
        }
        #chat-toggle-btn:hover {
            transform: scale(1.05);
            background: #2563eb;
        }
    </style>
</head>
