    <script>
        // [설정] n8n 웹훅 URL을 여기에 입력하세요
        // 예: 'https://your-n8n-instance.com/webhook/...'
        // n8n Chat Trigger 노드 설정에서 "Webhook URL"을 복사해서 넣으세요.
        const N8N_WEBHOOK_URL = 'https://daniel8824.app.n8n.cloud/webhook/2af2449a-0dfb-4e8d-a430-92a6af05c16c/chat'; 

        // --- 1. Dark Mode Logic ---
        function toggleDarkMode() {
            document.documentElement.classList.toggle('dark');
            const isDark = document.documentElement.classList.contains('dark');
            localStorage.setItem('theme', isDark ? 'dark' : 'light');
            updateThemeIcon();
        }

        function updateThemeIcon() {
            const isDark = document.documentElement.classList.contains('dark');
            const icon = document.getElementById('theme-icon');
            if (icon) {
                icon.textContent = isDark ? 'light_mode' : 'brightness_4';
            }
        }

        if (localStorage.theme === 'dark' || (!('theme' in localStorage) && window.matchMedia('(prefers-color-scheme: dark)').matches)) {
            document.documentElement.classList.add('dark');
        } else {
            document.documentElement.classList.remove('dark');
        }
        updateThemeIcon();

        // --- 2. Custom Chat Widget Logic ---
        function toggleChat() {
            const chatWindow = document.getElementById('chat-window');
            const chatBtnIcon = document.querySelector('#chat-toggle-btn span');

            if (chatWindow.style.display === 'flex') {
                chatWindow.style.display = 'none';
                chatWindow.classList.remove('animate-slide-in');
                chatBtnIcon.textContent = 'chat';
            } else {
                chatWindow.style.display = 'flex';
                chatWindow.classList.add('animate-slide-in');
                chatBtnIcon.textContent = 'close';
                document.getElementById('chat-input').focus();
            }
        }

        function handleKeyPress(e) {
            if (e.key === 'Enter') sendMessage();
        }

        async function sendMessage() {
            const input = document.getElementById('chat-input');
            const message = input.value.trim();
            if (!message) return;

            // 1. 사용자 메시지 화면에 추가
            addMessage(message, 'user');
            input.value = '';

            // 2. n8n 웹훅 URL이 설정되어 있는지 확인
            if (!N8N_WEBHOOK_URL) {
                setTimeout(() => {
                    addMessage("⚠️ n8n 웹훅 URL이 설정되지 않았습니다.<br>HTML 코드 내 'N8N_WEBHOOK_URL' 변수에 URL을 입력해주세요.", 'bot');
                }, 500);
                return;
            }

            // 3. 로딩 표시 (임시 메시지)
            const loadingMsgDiv = addMessage("생각 중...", 'bot', true);

            try {
                // 4. n8n으로 데이터 전송 (POST)
                // n8n Chat Trigger는 보통 { "chatInput": "사용자 메시지" } 형태를 받습니다.
                // 워크플로우 설정에 따라 필드명이 다를 수 있으니 확인 필요 (여기선 'chatInput' 가정)
                const response = await fetch(N8N_WEBHOOK_URL, {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                    },
                    body: JSON.stringify({ 
                        chatInput: message,
                        sessionId: 'session-' + Math.random().toString(36).substr(2, 9) // 간단한 세션 ID 생성
                    })
                });

                if (!response.ok) {
                    throw new Error(`Server error: ${response.status}`);
                }

                const data = await response.json();

                // 5. 로딩 메시지 제거
                if(loadingMsgDiv) loadingMsgDiv.remove();

                // 6. 봇 응답 표시
                // n8n 응답 포맷에 따라 수정 필요. 보통 { "output": "답변 텍스트" } 형태
                const botReply = data.output || data.text || JSON.stringify(data);
                addMessage(botReply, 'bot');

            } catch (error) {
                console.error('Error sending message:', error);
                if(loadingMsgDiv) loadingMsgDiv.remove();
                addMessage("죄송합니다. 서버 연결 중 오류가 발생했습니다.", 'bot');
            }
        }

        function addMessage(text, sender, isLoading = false) {
            const messagesDiv = document.getElementById('chat-messages');
            const msgDiv = document.createElement('div');
            msgDiv.className = `chat-msg ${sender === 'user' ? 'msg-user' : 'msg-bot'}`;
            msgDiv.innerHTML = text;
            if(isLoading) msgDiv.id = 'loading-msg'; // 로딩 메시지 식별용
            messagesDiv.appendChild(msgDiv);
            messagesDiv.scrollTop = messagesDiv.scrollHeight;
            return msgDiv;
        }

        // Mobile Menu
        function toggleMobileMenu() {
            document.getElementById('mobile-menu').classList.toggle('hidden');
        }
    </script>
